import React from 'react';
import logo from './logo.svg';
import './App.css';

import Login from './login';
import Register from './register';
import Reset from './reset';
import Timeline from './timeline';
import Singal_post from './singal_post';
import Upload from './upload_post';

class App extends React.Component{
  constructor(props){
    super(props);

    this.state={
      num: true
    }
  }

  fun =()=>{
    (this.state.num === true) ? (this.state.num = false) : (this.state.num = true)
  } 

  render(){
  return (
    <div>

    <Register />
    <Login />
    <Timeline change = {this.fun}/>

    <Upload />

    {(this.state.num === true) ? <Upload /> : (1)}



    </div>


  );
  }
}

export default App;
